import GoogleLogin from 'react-google-login';
import FacebookLogin from 'react-facebook-login/dist/facebook-login-render-props';
import nookies from 'nookies';
import { useContext } from 'react';

import { AuthModalContext } from '../../../contexts/AuthModalContext'
import api from '../../../services/api';
import Button from '../../button';
import ReactSVG from 'react-svg';

const successGoogle = async (response) => {
  const GOOGLE_ID = "561864175024-uilc5rn5v4l6rf6usg564c4v38ofcsgf.apps.googleusercontent.com";
  const GOOGLE_SECRET = "JNaFlNOkJk9sbSIwnKT1T97K";
  const { pkg_int_id: package_id_intention } = nookies.get({}, 'pkg_int_id')
  const { code } = useContext(AuthModalContext)

  const apiResponse = await api().post('auth/')

  console.log("API", api);
}

const failureGoogle = (response) => {
  console.log("failure google", response);
  console.log("\n");
  console.log(JSON.stringify(response));
}

const responseFacebook = (response) => {
  try {
    console.log("response facebook", JSON.stringify(response));
  } catch (err) {
    console.warn("Error in login");
  }
}

const SocialButtons = ({ socialLogin, setLoading }) => {
  return (
    <div className="social-btns">
      <GoogleLogin
        clientId="561864175024-uilc5rn5v4l6rf6usg564c4v38ofcsgf.apps.googleusercontent.com"
        buttonText="Google"
        onSuccess={successGoogle}
        onFailure={failureGoogle}
        cookiePolicy={'single_host_origin'}
        render={renderProps => (
          <Button 
            className="social google"
            type="button"
            onClick={renderProps.onClick}
            disabled={renderProps.disabled}
          >
            <ReactSVG className="icon" src="/static/icons/google.svg" />
            Google
          </Button>
        )}
      />

      <FacebookLogin
        appId="1168591320165413"
        fields="name,email,picture"
        scope="public_profile"
        callback={responseFacebook}
        render={renderProps => (
          <Button 
            className="social facebook"
            type="button"
            onClick={renderProps.onClick}
            disabled={renderProps.disabled}
          >
            <ReactSVG className="icon" src="/static/icons/facebook.svg" />
            Facebook
          </Button>
        )}
      />
      {/* <Button className="social facebook" type="button" onClick={socialLogin}>
        <ReactSVG className="icon" src="/static/icons/facebook.svg" />
        Facebook
      </Button>
      <Button className="social google" type="button" onClick={socialLogin}>
        <ReactSVG className="icon" src="/static/icons/google.svg" />
        Google
      </Button> */}
      <style jsx>{`
        .social-btns {
          display: flex;
          justify-content: space-around;
        }
      `}</style>
    </div>
  )
}

export default SocialButtons
